def remove_Occ(s,ch):
    """
    Given a string s and a character ch, remove the first and last occurrence of ch from s.
    For example:
    remove_Occ("hello world", 'l') == "heo worl"
    remove_Occ("programming", 'g') == "programmin"
    remove_Occ("abcd", 'a') == "bcd"
    """
    if not s:
        return s

    first_occurrence = -1
    last_occurrence = -1

    for i in range(len(s)):
        if s[i] == ch:
            if first_occurrence == -1:
                first_occurrence = i
            last_occurrence = i

    if first_occurrence == -1:
        return s

    new_string = ""
    for i in range(len(s)):
        if i != first_occurrence and i != last_occurrence:
            new_string += s[i]

    return new_string
