def find_Nth_Digit(p,q,N):
    """
    Given two integers p and q, find the Nth digit in the proper fraction p/q.
    For example:
    find_Nth_Digit(1,2,1) == 5
    find_Nth_Digit(1,3,1) == 3
    find_Nth_Digit(2,3,1) == 6
    find_Nth_Digit(4,7,3) == 9
    find_Nth_Digit(1,1000,5) == 0
    """
    fraction = str(p / q)
    if '.' not in fraction:
        return int(fraction[0])
    integer_part = int(fraction.split('.')[0])
    decimal_part = fraction.split('.')[1]
    if N <= len(decimal_part):
        return int(decimal_part[N - 1])
    else:
        decimal_part += '0' * (N - len(decimal_part))
        return int(decimal_part[N - 1])
```

