    """
    Given two integers A and B, find the last digit when factorial of A divides factorial of B.
    For example:
    compute_Last_Digit(5,10) == 0
    compute_Last_Digit(2,4) == 0
    compute_Last_Digit(1,5) == 1
    """
    if A > B:
        return 0
    if A == 0:
        return 1
    if B == 0:
        return 1
    fact_a = 1
    for i in range(1, A + 1):
        fact_a = fact_a * i
    fact_b = 1
    for i in range(1, B + 1):
        fact_b = fact_b * i
    if fact_b % fact_a == 0:
        return 1
    else:
        return 0
