def max_len_sub( arr, n):
    """
    Finds the maximum length of the subsequence with a difference between adjacent elements for the given array.

    Args:
        arr (list): The input array.
        n (int): The size of the array.

    Returns:
        int: The maximum length of the subsequence.
    """
    if n == 0:
        return 0

    dp = {}

    def solve(index, prev):
        if index == n:
            return 0

        if (index, prev) in dp:
            return dp[(index, prev)]

        take = 0
        if prev == -1 or abs(arr[index] - arr[prev]) == 1:
            take = 1 + solve(index + 1, index)

        skip = solve(index + 1, prev)

        dp[(index, prev)] = max(take, skip)
        return dp[(index, prev)]

    return solve(0, -1)
```

