def is_undulating(n):
    """
    Check whether the given number is undulating or not.
    An undulating number is a number whose digits alternate between two distinct values.
    For example, 121212 is an undulating number because its digits alternate between 1 and 2.
    123 is not an undulating number because its digits do not alternate between two distinct values.
    0 is an undulating number.
    Args:
        n (int): The number to check.
    Returns:
        bool: True if the number is undulating, False otherwise.
    """
    s = str(n)
    if len(s) == 0:
        return True
    if len(s) == 1:
        return True

    first_digit = s[0]
    second_digit = None

    for i in range(1, len(s)):
        if s[i] != first_digit:
            second_digit = s[i]
            break

    if second_digit is None:
        return True

    for i in range(len(s)):
        if i % 2 == 0:
            if s[i] != first_digit:
                return False
        else:
            if s[i] != second_digit:
                return False
    return True
```

