    A number is undulating if the digits alternate between two distinct values.
    For example:
    is_undulating(1212) == True
    is_undulating(1234) == False
    is_undulating(1122) == False
    """
    s = str(n)
    if len(s) < 2:
        return False
    first = s[0]
    second = None
    for i in range(1, len(s)):
        if second is None and s[i] != first:
            second = s[i]
        if second is None:
            return False
        if i % 2 == 0:
            if s[i] != first:
                return False
        else:
            if s[i] != second:
                return False
    if first == second:
        return False
    return True
