def eulerian_num(n, m):
    """
    Finds the Eulerian number a(n, m).

    Args:
        n: The first non-negative integer.
        m: The second non-negative integer.

    Returns:
        The Eulerian number a(n, m).
    """
    if n == 0:
        if m == 0:
            return 1
        else:
            return 0
    if m < 0 or m >= n:
        return 0

    dp = [[0 for _ in range(n + 1)] for _ in range(n + 1)]
    dp[0][0] = 1

    for i in range(1, n + 1):
        for j in range(i + 1):
            for k in range(j + 1):
                dp[i][j] += (i - k) * dp[i - 1][k]

    return dp[n][m]
```

