def eulerian_num(n, m):
    """
    Finds the Eulerian number a(n, m).

    The Eulerian numbers count the number of permutations of {1, 2, ..., n}
    such that exactly m elements are greater than all the elements to their left.

    Args:
        n: The total number of elements.
        m: The number of elements greater than all elements to their left.

    Returns:
        The Eulerian number a(n, m).
    """

    if n == 0:
        if m == 0:
            return 1
        else:
            return 0
    if m < 0 or m >= n:
        return 0

    dp = [[0 for _ in range(m + 1)] for _ in range(n + 1)]

    dp[0][0] = 1

    for i in range(1, n + 1):
        for j in range(m + 1):
            dp[i][j] = (i - j) * dp[i - 1][j] + (j + 1) * dp[i - 1][j + 1]

    return dp[n][m]
```

