    The Eulerian numbers count the number of permutations of {1, 2, ..., n}
    with exactly m ascents. An ascent is a pair (i, i+1) such that a[i] > a[i+1].

    Args:
        n: The number of elements in the permutation.
        m: The number of ascents.

    Returns:
        The Eulerian number a(n, m).
    """

    if n == 0:
        if m == 0:
            return 1
        else:
            return 0
    if m < 0 or m >= n:
        return 0

    dp = [[0 for _ in range(m + 1)] for _ in range(n + 1)]

    dp[0][0] = 1

    for i in range(1, n + 1):
        for j in range(m + 1):
            dp[i][j] = (j + 1) * dp[i - 1][j] + (i - j) * dp[i - 1][j - 1]

    return dp[n][m]
```

