def search(arr,n):
    """
    Given a sorted array arr[] of n integers where each element is a multiple of the next element,
    find the element that appears only once in the array.
    For example:
    search([1, 2, 2, 3, 3, 3, 4, 4, 4, 4], 10) == 1
    search([1, 2, 2, 3, 3, 3, 4, 4, 4, 4, 5], 11) == 1
    search([1, 1, 2, 2, 3, 3, 4, 4, 5], 9) == 5
    """
    if n == 0:
        return -1
    if n == 1:
        return arr[0]
    if arr[0] != arr[1]:
        return arr[0]
    if arr[n - 1] != arr[n - 2]:
        return arr[n - 1]
    for i in range(1, n - 1):
        if arr[i] != arr[i - 1] and arr[i] != arr[i + 1]:
            return arr[i]
    return -1
```

