def check_last_element(arr, p):
    """
    Checks whether the last element of a given array is even or odd after performing an operation p times.
    The operation is to add the second last element to the last element.

    Args:
        arr (list): The input array.
        p (int): The number of times the operation is performed.

    Returns:
        str: "Even" if the last element is even, "Odd" if the last element is odd.
    """

    if not arr or len(arr) < 2:
        if arr:
            if arr[0] % 2 == 0:
                return "Even"
            else:
                return "Odd"
        else:
            return "Even"  # Or handle empty array case as needed

    last_element = arr[-1]
    for _ in range(p):
        last_element = last_element + arr[-2]

    if last_element % 2 == 0:
        return "Even"
    else:
        return "Odd"
```

