def max_path_sum(tri, m, n):
    """
    Given a triangle, find the maximum total from top to bottom. Each step you may move to adjacent numbers on the row below.
    :param tri: list[list[int]]
    :param m: int
    :param n: int
    :return: int
    """
    dp = tri[0]
    for i in range(1, m):
        new_dp = [0] * (n + 1)
        for j in range(n + 1):
            if j == 0:
                new_dp[j] = dp[j] + tri[i][j]
            elif j == n:
                new_dp[j] = dp[j - 1] + tri[i][j]
            else:
                new_dp[j] = max(dp[j - 1], dp[j]) + tri[i][j]
        dp = new_dp
    return max(dp)
```

