def max_path_sum(tri, m, n):
    """
    Given a triangle, find the maximum total from top to bottom. Each step you may move to adjacent numbers on the row below.
    :param tri: a list of list of integers
    :param m: the number of rows in the triangle
    :param n: the number of elements in the last row of the triangle
    :return: the maximum total from top to bottom
    """
    dp = [([0] * n) for _ in range(m)]

    for i in range(m):
        for j in range(n - i):
            if i == 0:
                dp[i][j] = tri[i][j]
            else:
                dp[i][j] = tri[i][j] + max(dp[i - 1][j], dp[i - 1][j + 1])

    return max(dp[m - 1])
