def count_char_position(str1):
    """
    Counts characters at the same position in a given string (lower and uppercase characters) as in the English alphabet.

    Args:
      str1: The input string.

    Returns:
      The count of characters that match their position in the alphabet (A=1, B=2, ..., Z=26).
    """
    count = 0
    for i, char in enumerate(str1):
        if 'a' <= char <= 'z':
            if ord(char) - ord('a') + 1 == i + 1:
                count += 1
        elif 'A' <= char <= 'Z':
            if ord(char) - ord('A') + 1 == i + 1:
                count += 1
    return count
