def find_even_Pair(A,N):
    """
    Given an array A[] of N integers, count the number of pairs (i, j)
    such that A[i] XOR A[j] is even.
    """
    count = 0
    for i in range(N):
        for j in range(i + 1, N):
            if (A[i] ^ A[j]) % 2 == 0:
                count += 1
    return count
