def fourth_Power_Sum(n):
    """
    This function calculates the sum of the fourth power of the first n natural numbers.
    """
    if n <= 0:
        return 0
    else:
        return (n * (n + 1) * (2*n + 1) * (3*n*n + 3*n - 1)) // 30
