def binary_search(arr, low, high, x):
    """
    Performs binary search on a sorted array to find the index of a given element.

    Args:
        arr (list): The sorted array to search.
        low (int): The starting index of the search space.
        high (int): The ending index of the search space.
        x (int): The element to search for.

    Returns:
        int: The index of the element if found, otherwise -1.
    """
    while low <= high:
        mid = (low + high) // 2
        if arr[mid] == x:
            return mid
        elif arr[mid] < x:
            low = mid + 1
        else:
            high = mid - 1
    return -1

def find_majority_element(arr):
    """
    Finds the majority element in a sorted array using binary search.

    A majority element is an element that appears more than n/2 times in an array of size n.

    Args:
        arr (list): The sorted array to search.

    Returns:
        int: The majority element if it exists, otherwise -1.
    """
    n = len(arr)
    if n == 0:
        return -1

    candidate = arr[n // 2]
