def binary_search(arr, low, high, x):
    """
    Performs binary search on a sorted array to find the index of a given element.

    Args:
        arr (list): The sorted array to search.
        low (int): The starting index of the search space.
        high (int): The ending index of the search space.
        x (int): The element to search for.

    Returns:
        int: The index of the element if found, otherwise -1.
    """
    while low <= high:
        mid = (low + high) // 2
        if arr[mid] == x:
            return mid
        elif arr[mid] < x:
            low = mid + 1
        else:
            high = mid - 1
    return -1

def find_majority_element(arr):
    """
    Finds the majority element in a sorted array. A majority element is an element that appears more than n/2 times in the array,
    where n is the size of the array.

    Args:
        arr (list): The sorted array to search.

    Returns:
        int: The majority element if it exists, otherwise -1.
    """
    n = len(arr)
    if n == 0:
        return -1

    candidate = arr[n // 2]
    first_occurrence = binary_search(arr, 0, n - 1, candidate)

    if first_occurrence != -1:
        if first_occurrence + n // 2 < n and arr[first_occurrence + n // 2] == candidate:
            return candidate
        elif first_occurrence - n // 2 >= 0 and arr[first_occurrence - n // 2] == candidate:
            return candidate
        elif first_occurrence == 0 and first_occurrence + n // 2 < n and arr[first_occurrence + n // 2] == candidate:
            return candidate
        elif first_occurrence == n - 1 and first_occurrence - n // 2 >= 0 and arr[first_occurrence - n // 2] == candidate:
            return candidate
        elif first_occurrence + n//2 < n and arr[first_occurrence + n//2] == candidate:
            count = 0
            for i in range(n):
                if arr[i] == candidate:
                    count += 1
            if count > n // 2:
                return candidate
        elif first_occurrence - n//2 >= 0 and arr[first_occurrence - n//2] == candidate:
            count = 0
            for i in range(n):
                if arr[i] == candidate:
                    count += 1
            if count > n // 2:
