def max_sum(tri, n):
    """
    Finds the maximum sum in the given right triangle of numbers.

    Args:
        tri (list of lists): A list of lists representing the right triangle of numbers.
        n (int): The number of rows in the triangle.

    Returns:
        int: The maximum sum from the top to the bottom of the triangle.
    """

    dp = tri[:]  # Create a copy of the triangle to store the maximum sums

    for i in range(1, n):
        for j in range(i + 1):
            if j == 0:
                dp[i][j] += dp[i - 1][j]
            else:
                dp[i][j] += max(dp[i - 1][j - 1], dp[i - 1][j])

    return max(dp[n - 1])
```

