def division_elements(test_tup1, test_tup2):
    """
    Performs mathematical division operation across the given tuples.

    Args:
        test_tup1 (tuple): The first tuple containing numbers.
        test_tup2 (tuple): The second tuple containing numbers.

    Returns:
        tuple: A tuple containing the result of element-wise division.
               Returns an empty tuple if tuples have different lengths or if division by zero occurs.
    """
    if len(test_tup1) != len(test_tup2):
        return ()

    result = tuple()
    for i in range(len(test_tup1)):
        if test_tup2[i] == 0:
            return ()
        result += (test_tup1[i] / test_tup2[i],)

    return result
