def count_first_elements(test_tup):
  """
  Given a tuple, find the element count that occurs before the record in the given tuple.
  For example:
  count_first_elements((1, 2, 3, 1, 2, 1)) == {1: 2, 2: 2, 3: 1}
  count_first_elements((5, 5, 5, 5, 5)) == {5: 4}
  count_first_elements((1, 2, 3, 4, 5)) == {1: 1, 2: 1, 3: 1, 4: 1, 5: 1}
  """
  res = {}
  for i in test_tup:
    if i in res:
      res[i] += 1
    else:
      res[i] = 1
  new_res = {}
  for i in test_tup:
    if i in new_res:
      continue
    else:
      new_res[i] = res[i]
  return new_res
