def validate(n):
    """
    Given a non-negative integer n, return True if the frequency of each digit is less than or equal to the digit itself.
    Otherwise, return False.
    For example:
    validate(123) == True
    validate(123456789) == True
    validate(1234567890) == False
    validate(1234567891) == False
    """
    s = str(n)
    freq = {}
    for digit in s:
        if digit in freq:
            freq[digit] += 1
        else:
            freq[digit] = 1
    for digit, count in freq.items():
        if int(digit) < count:
            return False
    return True
```

