def intersection_nested_lists(l1, l2):
    """
    Finds the nested list elements which are present in another list.

    Args:
        l1: The first list containing nested lists.
        l2: The second list.

    Returns:
        A list containing the elements from the nested lists in l1 that are also present in l2.
    """
    intersection = []
    for sublist in l1:
        if isinstance(sublist, list):
            for element in sublist:
                if element in l2:
                    intersection.append(element)
        else:
            if sublist in l2:
                intersection.append(sublist)
    return intersection
