def count_binary_seq(n):
    """
    Find the count of all binary sequences of length 2n such that sum of first n bits is same as sum of last n bits.

    Args:
        n (int): The length of the first half of the binary sequence.

    Returns:
        int: The count of binary sequences that satisfy the condition.
    """
    if n == 0:
        return 1

    dp = {}

    def solve(index, current_sum):
        if index == n:
            return 1 if current_sum == 0 else 0

        if (index, current_sum) in dp:
            return dp[(index, current_sum)]

        dp[(index, current_sum)] = solve(index + 1, current_sum + 1) + solve(index + 1, current_sum - 1)
        return dp[(index, current_sum)]

    return solve(0, 0)
