def solve(a,n):
    """
    Given an array a of n integers. The task is to check whether the count of inversion of two types are same or not.
    Inversion means a[i] > a[j] where i < j.
    """
    count1 = 0
    for i in range(n):
        for j in range(i + 1, n):
            if a[i] > a[j]:
                count1 += 1

    count2 = 0
    for i in range(n - 1, -1, -1):
        for j in range(i - 1, -1, -1):
            if a[i] > a[j]:
                count2 += 1

    return count1 == count2
