def max_sum_increasing_subseq(a, n, index, k):
    """
    Finds the maximum sum of increasing subsequence from prefix till ith index and also including a given kth element which is after i, i.e., k > i.

    Args:
        a (list): The input list of numbers.
        n (int): The length of the input list.
        index (int): The index up to which the increasing subsequence is considered.
        k (int): The index of the element that must be included in the subsequence (k > index).

    Returns:
        int: The maximum sum of the increasing subsequence.
    """

    if index < 0 or k < 0 or k >= n or index >= n or k <= index:
        return 0

    max_sum = 0
    for i in range(1 << index):
        subsequence = []
        current_sum = 0
        for j in range(index):
            if (i >> j) & 1:
                subsequence.append(a[j])
                current_sum += a[j]

        is_increasing = True
        for l in range(len(subsequence) - 1):
            if subsequence[l] >= subsequence[l + 1]:
                is_increasing = False
                break

        if is_increasing:
            if len(subsequence) == 0:
                if a[k] > (subsequence[-1] if subsequence else float('-inf')):
                    max_sum = max(max_sum, a[k])
            elif a[k] > subsequence[-1]:
                max_sum = max(max_sum, current_sum + a[k])
    return max_sum
```

