def find_demlo(s):
    """
    A Demlo number is a number that can be expressed as the sum of the factorials of its digits.
    For example, 145 is a Demlo number because 1! + 4! + 5! = 1 + 24 + 120 = 145.
    Given a number s, find the Demlo number for the given number.
    If the number is not a Demlo number, return -1.
    For example:
    find_demlo(145) == 145
    find_demlo(10) == -1
    find_demlo(2) == 2
    """
    def factorial(n):
        if n == 0:
            return 1
        else:
            return n * factorial(n-1)

    sum_of_factorials = 0
    for digit in str(s):
        sum_of_factorials += factorial(int(digit))

    if sum_of_factorials == s:
        return s
    else:
        return -1
