def re_arrange(arr, n):
    """
    Rearranges the given array in alternating positive and negative items.

    Args:
        arr (list): The input array.
        n (int): The size of the array.

    Returns:
        list: The rearranged array.
    """
    pos = 0
    neg = 0

    while pos < n and neg < n:
        while pos < n and arr[pos] >= 0:
            pos += 1

        while neg < n and arr[neg] < 0:
            neg += 1

        if pos < neg:
            arr[pos], arr[neg] = arr[neg], arr[pos]

    pos = 0
    neg = 1

    while pos < n and neg < n:
        while pos < n and arr[pos] >= 0:
            pos += 2

        while neg < n and arr[neg] < 0:
            neg += 2

        if pos < neg:
            arr[pos], arr[neg] = arr[neg], arr[pos]

    return arr
