def zigzag(n, k):
    """
    Finds the entringer number e(n, k).

    The entringer number e(n, k) is the number of permutations of {1, 2, ..., n}
    such that each permutation has exactly k rises. A rise is a pair (i, i+1) such that
    permutation[i] < permutation[i+1].

    Args:
        n: The size of the permutation.
        k: The number of rises.

    Returns:
        The entringer number e(n, k).
    """

    if k > n - 1 or k < 0:
        return 0
    if n == 0 and k == 0:
        return 1
    if n == 0 or k == 0:
        return 0

    dp = {}

    def solve(n, k):
        if (n, k) in dp:
