def find_ways(M):
    """
    Given an integer M, find the number of sequences of length M having non-negative prefix sums that can be generated by given values.
    For example:
    find_ways(1) == 1
    find_ways(2) == 2
    find_ways(3) == 4
    find_ways(4) == 8
    """
    if M == 1:
        return 1
    elif M == 2:
        return 2
    elif M == 3:
        return 4
    elif M == 4:
        return 8
    else:
        return 2** (M-1)
