def remove_column(list1, n):
    """
    Remove a specified column from a given nested list.

    Args:
        list1 (list): The nested list.
        n (int): The index of the column to be removed.

    Returns:
        list: The nested list with the specified column removed.
    """
    if not isinstance(list1, list):
        raise TypeError("Input must be a list.")
    if not all(isinstance(row, list) for row in list1):
        raise TypeError("Input must be a nested list (list of lists).")
    if not isinstance(n, int):
        raise TypeError("Column index must be an integer.")
    if n < 0:
        raise ValueError("Column index must be non-negative.")

    result = []
    for row in list1:
        if not isinstance(row, list):
            raise TypeError("Each element of the list must be a list.")
        if n >= len(row):
            result.append(row)  # Column index out of bounds, keep the row as is
        else:
            result.append(row[:n] + row[n+1:])
    return result
