def permute_string(str):
    """
    Prints all permutations of a given string including duplicates.

    Args:
        str: The input string.
    """
    def backtrack(combination, counter):
        if len(combination) == len(str):
            print("".join(combination))
            return

        for char in counter:
            if counter[char] > 0:
                combination.append(char)
                counter[char] -= 1
                backtrack(combination, counter)
                counter[char] += 1
                combination.pop()

    counter = {}
    for char in str:
        counter[char] = counter.get(char, 0) + 1

    backtrack([], counter)
```

