    For example:
    convert_list_dictionary(['A', 'B', 'C'], ['X', 'Y', 'Z'], [1, 2, 3]) ==
    {'A': {'X': {'1': None}}, 'B': {'Y': {'2': None}}, 'C': {'Z': {'3': None}}}
