      l1: The first list, representing the keys for the outermost dictionary.
      l2: The second list, representing the keys for the inner dictionaries.
      l3: The third list, representing the values for the innermost level.

    Returns:
      A nested dictionary where l1 keys are the outer keys, l2 keys are the
      inner keys, and l3 values are the innermost values.
      Returns an empty dictionary if the lists have different lengths.
    """

    if len(l1) != len(l2) or len(l1) != len(l3):
        return {}

    nested_dict = {}
    for i in range(len(l1)):
        nested_dict[l1[i]] = {}
        for j in range(len(l2)):
            if i == j:
                nested_dict[l1[i]][l2[j]] = l3[i]

    return nested_dict
```

