            max1 = arr[i]
        elif arr[i] > max2:
            max2 = arr[i]

        if arr[i] < min1:
            min2 = min1
            min1 = arr[i]
        elif arr[i] < min2:
            min2 = arr[i]

    if max1 * max2 > min1 * min2:
        return (max1, max2)
    else:
