def breakSum(n):
    """
    Finds the maximum sum we can make by dividing a number into three parts recursively and summing them up.

    Args:
        n: The number to be divided.

    Returns:
        The maximum sum achievable by dividing the number into three parts.
    """

    if n <= 0:
        return 0

    if n == 1:
        return 1

    if n == 2:
        return 2

    if n == 3:
        return 3

    max_sum = 0
    for i in range(1, n - 1):
        for j in range(1, n - i):
            k = n - i - j
            if k > 0:
                current_sum = i + j + k
                max_sum = max(max_sum, current_sum)

    return max_sum
```

