def parabola_directrix(a, b, c):
    """
    Finds the directrix of a parabola given its coefficients.

    Args:
        a: The coefficient of x^2.
        b: The coefficient of xy.
        c: The coefficient of y^2.

    Returns:
        The y-coordinate of the directrix.
    """
    if a == 0 and c == 0:
        return None  # Not a parabola

    if a == 0:
        # Parabola of the form y = ax^2 + bx + c
        if b == 0:
            if a != 0:
                return -c / (4 * a)
            else:
                return None
        else:
            return None # Not a standard parabola

    if c == 0:
        # Parabola of the form x = ay^2 + by + c
        if b == 0:
            if a != 0:
                return -c / (4 * a)
            else:
                return None
        else:
            return None # Not a standard parabola

    # General form: ax^2 + bxy + cy^2 + dx + ey + f = 0
    # For a parabola, b^2 - 4ac = 0
    # The directrix is given by y = -e / (2 * c) if a = 0 and c != 0
    # or x = -d / (2 * a) if c = 0 and a != 0
    # In general case, we need to rotate the parabola to standard form

    if b == 0 and a == 0:
        return None

    if a == 0:
        return -c / (4 * a)

    if c == 0:
        return None

    return None
```

