def extract_string(str, l):
    """
    Extract specified size of strings from a give list of string values.

    For example:
    extract_string("abc", ["ab", "abc", "abcd"]) == ["ab", "abc"]
    extract_string("ab", ["ab", "abc", "abcd"]) == ["ab"]
    extract_string("abc", ["a", "ab", "abc", "abcd"]) == ["ab", "abc"]
    """
    result = []
    for s in l:
        if len(s) == len(str):
            result.append(s)
        elif len(s) < len(str):
            continue
        else:
            if s[:len(str)] == str:
                result.append(s[:len(str)])
    return result
```

