def is_subset_sum(set, n, sum):
    """
    Given a set of non-negative integers, and a value sum,
    determine if there is a subset of the given set with sum equal to the given sum.
    For example:
    is_subset_sum([3, 34, 4, 12, 5, 2], 6, 9) == True
    is_subset_sum([3, 34, 4, 12, 5, 2], 6, 30) == False
    """
    dp = [[False for i in range(sum + 1)] for j in range(n + 1)]
    for i in range(n + 1):
        dp[i][0] = True
    for i in range(1, sum + 1):
        dp[0][i] = False
    for i in range(1, n + 1):
        for j in range(1, sum + 1):
            if set[i - 1] <= j:
                dp[i][j] = dp[i - 1][j - set[i - 1]] or dp[i - 1][j]
            else:
                dp[i][j] = dp[i - 1][j]
    return dp[n][sum]
```

