def sum_gp(a,n,r):
    """
    This function calculates the sum of a geometric progression series.
    a: the first term of the series
    n: the number of terms in the series
    r: the common ratio of the series
    """
    if r == 1:
        return a * n
    else:
        return a * (1 - r**n) / (1 - r)
